sys_variable_value.value:
(function execute(inputs, outputs) {

  var result = new x_58056_rf.RequestFulfillment().getApprovalDetails(inputs.reqItemGR, inputs.activityID);
  outputs.activity_required = result.condition;
  outputs.activity_display = result.display;
  outputs.groups = result.groups;
  outputs.users = result.users;
  outputs.subtype = result.subType;
  outputs.skip = result.skip;
  outputs.wait_for = result.waitFor;

})(inputs, outputs);

